import React from "react";
import "./App.css";
import Machinebox from "./components/Machinebox";

// Componentes HTML
const titulo = "Maquinator:";

const data = [
  // ponemos column en vez de Row, pk cuando se carga  lo hace de arriba a bajo.
  {
    column0: "Ø10,7",
    column1: "3820",
    column2: "3825",
    column3: "A3",
    column4: "A4",
    column5: "A5",
    column6: "A6",
    column7: "A7",
    column8: "A8",
    column9: "1",
  },
  {
    column0: "Ø12",
    column1: "NR-535",
    column2: "NR-541",
    column3: "B3",
    column4: "B4",
    column5: "B5",
    column6: "B6",
    column7: "B7",
    column8: "B8",
    column9: "2",
  },
  {
    column0: "Ø12,7",
    column1: "3720",
    column2: "3725",
    column3: "C3",
    column4: "C4",
    column5: "C5",
    column6: "C6",
    column7: "C7",
    column8: "C8",
    column9: "3",
  },
  {
    column0: "Ø15",
    column1: "NR-550",
    column2: "NR 620",
    column3: "D3",
    column4: "D4",
    column5: "D5",
    column6: "D6",
    column7: "D7",
    column8: "D8",
    column9: "2",
  },
  {
    column0: "Ø19",
    column1: "NR-567",
    column2: "",
    column3: "E3",
    column4: "E4",
    column5: "E5",
    column6: "E6",
    column7: "E7",
    column8: "E8",
    column9: "1",
  },
];

function App() {
  return (
    <div className="App">
      <h1> {titulo} </h1>

      <div className="table">
        <table>
          <tr>
            <th>Valores</th>
            <th>
              <img src={require("./img/electrodos/1.png")} alt="Logo" />{" "}
            </th>
            <th>
              <img src={require("./img/electrodos/2.png")} alt="Logo" />{" "}
            </th>
            <th>
              <img src={require("./img/electrodos/3.png")} alt="Logo" />{" "}
            </th>
            <th>
              <img src={require("./img/electrodos/4.png")} alt="Logo" />{" "}
            </th>
            <th>
              <img src={require("./img/electrodos/5.png")} alt="Logo" />{" "}
            </th>
            <th>
              <img src={require("./img/electrodos/6.png")} alt="Logo" />{" "}
            </th>
            <th>
              <img src={require("./img/electrodos/7.png")} alt="Logo" />{" "}
            </th>
            <th>
              <img src={require("./img/electrodos/8.png")} alt="Logo" />{" "}
            </th>
            <th>
              <img src={require("./img/electrodos/9.png")} alt="Logo" />{" "}
            </th>
          </tr>

          {data.map((val, key) => {
            return (
              <tr key={key}>
                <td>{val.column0}</td>
                <td>{val.column1}</td>
                <td>{val.column2}</td>
                <td>{val.column3}</td>
                <td>{val.column4}</td>
                <td>{val.column5}</td>
                <td>{val.column6}</td>
                <td>{val.column7}</td>
                <td>{val.column8}</td>
                <td>
                  <Machinebox ruta={val.column9} />
                </td>
              </tr>
            );
          })}
        </table>
      </div>
      <h1>Zona de pruebas</h1>
    </div>
  );
}

export default App;
